  </div>
  <nav>
    <input type="checkbox" id="menu-toggle" />
    <label for="menu-toggle" class="hamburger-menu">&#9776;</label>
    <ul class="nav-links">
      <li><a href="#">Home</a></li>
      <li><a href="#">About</a></li>
      <li><a href="#">Contact Us</a></li>
    </ul>
  </nav>
</header>


    </div>
  );
}

